import {Routes,Route} from 'react-router-dom'
import Login from './component/Login'
import Header from './component/Header';
import { AuthProvider } from './auth';

function App() {
  return (
    <AuthProvider>
    <Header />
   <Routes>
    <Route path="/login" element={<Login />}/>

    <Route path="*" element={<Login />}/>
   </Routes>
    </AuthProvider> 
  );
}

export default App;
